import React from 'react';
import Main from './Main'

const TableData = (props) => {
    return props.ratesTable.map((student, index) => {
       const { currency, code, mid} = student 
       return (
          <>
          <tr  key={index}>
             <td>{currency}</td>
             <td>{code}</td>
             <td>{mid}</td>
          </tr>
          {/* <button onClick={() => props.onclick(student)}>remove</button> */}
          <Main onclick={props.onclick} student={student} /> 
          </>
       )
    })
 }

 export default TableData;
